import math

def minimum_packages_needed(n, k):

    def get_divisors(n, k):
        divisors = []
        limit = min(int(math.sqrt(n)), k)
        for i in range(1, limit + 1):
            if n % i == 0:
                divisors.append(i)
                if i != n // i and n // i <= k:
                    divisors.append(n // i)
        return divisors
    if n < k:
        return 1
    divisors = get_divisors(n, k)
    divisors.sort()
    max_valid_divisor = divisors[-1]
    return n // max_valid_divisor

